import React from 'react';


const Header = () => {
  return (
    <div>
      <div className='text-3xl font-bold '>
        <h1>E-Commerce Project</h1>
      </div>
      <div className='bg-slate-600 text-white flex space-x-4 p-4'>
        <button className='hover:bg-slate-700 px-3 py-1 rounded'>About</button>
        <button className='hover:bg-slate-700 px-3 py-1 rounded'>Program List</button>
        <button className='hover:bg-slate-700 px-3 py-1 rounded'>Community</button>
        <button className='hover:bg-slate-700 px-3 py-1 rounded'>Contact</button>
      </div>
      <div className='flex space-x-4 p-4'>
        <button className='bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600'>Login</button>
        <button className='bg-green-500 text-white px-4 py-2 rounded hover:bg-green-600'>Sign Up</button>
      </div>
    </div>
  );
}

export default Header;
